import React from 'react';
import {Container,Row,Col} from 'react-bootstrap';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faEnvelopeOpen,faMobileAlt,faPhoneAlt  } from '@fortawesome/free-solid-svg-icons';
import 'bootstrap/dist/css/bootstrap.min.css';
import "./css/GridLay.css";


function Prefoot(){
    return(
     <div id="" >
         <Container  >
             <Row>
                 <Col lg={4}>
                 <p><FontAwesomeIcon icon={faEnvelopeOpen}/> GET SPECIAL DISCOUNT IN YOUR INBOX</p>
                 
                 </Col>
                 
                 
                 <Col lg={4}>
                 <p><FontAwesomeIcon icon={faMobileAlt}/> EXPERIENCE THE NYKAA MOBILE APP</p>
                 <Row>
                     <Col><path d="M130 40H5c-2.8 0-5-2.2-5-5V5c0-2.8 2.2-5 5-5h125c2.8 0 5 2.2 5 5v30c0 2.8-2.2 5-5 5z"></path></Col>
                     <Col><path d="M8.4 39.1h-.9c-.6 0-1.3-.1-1.9-.2-.6-.1-1.1-.3-1.7-.5-.5-.3-1-.6-1.4-1-.4-.4-.8-.9-1-1.4-.3-.5-.4-1.1-.5-1.7-.1-.6-.2-1.2-.2-1.9v-24-.9c0-.6.1-1.3.2-1.9.1-.5.3-1.1.6-1.6s.6-1 1-1.4c.4-.4.9-.7 1.4-1 .5-.3 1.1-.4 1.7-.5C6.3 1 6.9.9 7.6.9H112.2c.6 0 1.2.1 1.9.2.6.1 1.1.3 1.7.5 1 .5 1.9 1.4 2.4 2.4.3.5.4 1.1.5 1.6.1.6.2 1.3.2 1.9v24.9c0 .6-.1 1.2-.2 1.9-.1.6-.3 1.1-.5 1.7-.3.5-.6 1-1 1.4-.4.4-.9.8-1.4 1-.5.3-1.1.5-1.7.5-.6.1-1.2.2-1.9.2H8.4z"></path></Col>
                 </Row>
                 </Col>
                 
                 
                 
                 <Col lg={4}>
                 <p><FontAwesomeIcon icon={faPhoneAlt}/> FOR ANY HELP YOU MAY CALL US AT 1800-267-4444</p>
                 <p>(Monday to Saturday, 8AM to 10PM and Sunday, 10AM to 7PM)</p>
                 </Col>
             </Row>
         </Container>    
     </div>
    ) ;
 }
 export default Prefoot;
